t ref=\"country_of_origin\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			<xsd:element ref=\"patent_number\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n		</xsd:sequence>\r\n	</xsd:complexType>\r\n</xsd:schema>\r\n','PatentMD','',''),(48,'FezHistory','1.0','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<xsd:schema xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\">\r\n\r\n<!-- the root element for FezHistory-->\r\n<xsd:element name=\"FezHistory\" type=\"FezHistoryType\"/>\r\n\r\n<xsd:complexType name=\"FezHistoryType\">\r\n    <xsd:sequence>\r\n      <xsd:element name=\"audit\" type=\"auditType\" />\r\n    </xsd:sequence>\r\n</xsd:complexType>\r\n\r\n<xsd:complexType name=\"auditType\">\r\n  <xsd:sequence>\r\n        <xsd:element name=\"audit_id\"/>\r\n        <xsd:element name=\"audit_date\"/>\r\n        <xsd:element name=\"audit_user_id\"/>\r\n        <xsd:element name=\"audit_user_full_name\"/>\r\n        <xsd:element name=\"audit_justification\"/>\r\n        <xsd:element name=\"audit_pid\"/>\r\n        <xsd:element name=\"audit_dsID\"/>\r\n  </xsd:sequence>\r\n</xsd:complexType>\r\n\r\n\r\n</xsd:schema>\r\n','FezHistory','',''),(49,'vCard','3.0','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<schema\r\n	targetNamespace=\"http://www.w3.org/2001/vcard-rdf/3.0#\"\r\n	xmlns=\"http://www.w3.org/2001/XMLSchema\"\r\n	xmlns:xlink=\"http://www.w3.org/1999/xlink\"\r\n	xmlns:vCard=\"http://www.w3.org/2001/vcard-rdf/3.0#\"\r\n	elementFormDefault=\"qualified\"\r\n	attributeFormDefault=\"qualified\">\r\n\r\n\r\n	<annotation>\r\n		<documentation xml:lang=\"en\">\r\n			vCard XML Schema\r\n                        see http://imlsdcc.grainger.uiuc.edu/registry/default.asp\r\n			Created by Tom Habing, thabing@uiuc.edu\r\n\r\n			XML Schema for representing vCards in XML\r\n\r\n			This schema is based on the Representing vCard Objects in RDF/XML at the W3C http://www.w3.org/TR/vcard-rdf\r\n\r\n		$Workfile:   $ $Revision:   $\r\n\r\n    Last Updated by $Author:   $ on $Modtime:   $\r\n\r\n    $History: vCard.xsd $\r\n\r\n		</documentation>\r\n\r\n		<appinfo xmlns:dc=\"http://purl.org/dc/elements/1.1/\">\r\n			<dc:title>vCard XML Schema</dc:title>\r\n			<dc:creator>Tom Habing, thabing@uiuc.edu</dc:creator>\r\n			<dc:relation>http://www.w3.org/TR/vcard-rdf</dc:relation>\r\n			<dc:relation>ftp://ftp.isi.edu/in-notes/rfc2426.txt</dc:relation>\r\n		</appinfo>\r\n	</annotation>\r\n\r\n  <import namespace=\"http://www.w3.org/XML/1998/namespace\" schemaLocation=\"http://www.w3.org/2001/03/xml.xsd\"/>\r\n	<import namespace=\"http://www.w3.org/1999/xlink\" schemaLocation=\"http://www.loc.gov/standards/mets/version14/xlink.xsd\"/>\r\n\r\n	<element name=\"VCARD\">\r\n		<complexType>\r\n			<sequence>\r\n				<any namespace=\"##targetNamespace\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			\r\n\r\n	<element name=\"FN\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"NICKNAME\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"BDAY\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"MAILER\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"GEO\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"TITLE\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"ROLE\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"CATEGORIES\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"NAME\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"SOURCE\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"NOTE\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"PRODID\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"REV\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"SORT-STRING\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"CLASS\" type=\"vCard:simpleElement\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n	<element name=\"TEL\">\r\n		<complexType>\r\n    	<simpleContent>\r\n     		<extension base=\"string\">\r\n      		<attribute name=\"TYPE\" default=\"voice\">\r\n    				<simpleType>\r\n    					<list>\r\n    						<simpleType>\r\n        					<restriction base=\"string\">\r\n          					<enumeration value=\"home\"/>\r\n          					<enumeration value=\"msg\"/>\r\n          					<enumeration value=\"work\"/>\r\n          					<enumeration value=\"pref\"/>\r\n          					<enumeration value=\"voice\"/>\r\n          					<enumeration value=\"fax\"/>\r\n          					<enumeration value=\"cell\"/>\r\n          					<enumeration value=\"video\"/>\r\n          					<enumeration value=\"pager\"/>\r\n          					<enumeration value=\"bbs\"/>\r\n          					<enumeration value=\"modem\"/>\r\n          					<enumeration value=\"car\"/>\r\n          					<enumeration value=\"isdn\"/>\r\n          					<enumeration value=\"pcs\"/>\r\n        					</restriction>\r\n      					</simpleType>\r\n     					</list>\r\n    				</simpleType>\r\n      		</attribute>\r\n      		<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n     		</extension>\r\n    	</simpleContent>\r\n   	</complexType>\r\n	</element>\r\n\r\n	<element name=\"EMAIL\">\r\n		<complexType>\r\n    	<simpleContent>\r\n     		<extension base=\"string\">\r\n      		<attribute name=\"TYPE\" default=\"internet\">\r\n    				<simpleType>\r\n    					<list>\r\n    						<simpleType>\r\n        					<restriction base=\"string\">\r\n          					<enumeration value=\"internet\"/>\r\n          					<enumeration value=\"x400\"/>\r\n          					<enumeration value=\"pref\"/>\r\n        					</restriction>\r\n      					</simpleType>\r\n     					</list>\r\n    				</simpleType>\r\n      		</attribute>\r\n      		<attribute name=\"OTHERTYPE\" type=\"string\"/>\r\n      		<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n     		</extension>\r\n    	</simpleContent>\r\n   	</complexType>\r\n	</element>\r\n\r\n	<element name=\"ADR\">\r\n		<complexType>\r\n    	<sequence>\r\n    		<element name=\"Pobox\" minOccurs=\"0\"  maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    		<element name=\"Extadd\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    		<element name=\"Street\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    		<element name=\"Locality\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    		<element name=\"Region\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    		<element name=\"Pcode\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    		<element name=\"Country\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    	</sequence>\r\n   		<attribute name=\"TYPE\" default=\"intl postal parcel work\">\r\n 				<simpleType>\r\n 					<list>\r\n 						<simpleType>\r\n     					<restriction base=\"string\">\r\n       					<enumeration value=\"dom\"/>\r\n       					<enumeration value=\"intl\"/>\r\n       					<enumeration value=\"postal\"/>\r\n       					<enumeration value=\"parcel\"/>\r\n       					<enumeration value=\"home\"/>\r\n       					<enumeration value=\"work\"/>\r\n								<enumeration value=\"pref\"/>\r\n							</restriction>\r\n						</simpleType>\r\n					</list>\r\n 				</simpleType>\r\n   		</attribute>\r\n   		<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n   	</complexType>\r\n	</element>\r\n\r\n	<element name=\"ORG\">\r\n		<complexType>\r\n    	<sequence>\r\n    		<element name=\"Orgname\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    		<element name=\"Orgunit\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    	</sequence>\r\n    	<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n    </complexType>\r\n	</element>\r\n\r\n	<element name=\"N\">\r\n		<complexType>\r\n    	<sequence>\r\n    		<element name=\"Family\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    		<element name=\"Given\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    		<element name=\"Other\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    		<element name=\"Prefix\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    		<element name=\"Suffix\" minOccurs=\"0\" maxOccurs=\"unbounded\" type=\"vCard:simpleElement\"/>\r\n    	</sequence>\r\n    	<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n    </complexType>\r\n	</element>\r\n\r\n	<element name=\"LABEL\">\r\n		<complexType>\r\n    	<complexContent mixed=\"true\">\r\n				<restriction base=\"anyType\">\r\n        	<sequence>\r\n         		<any processContents=\"lax\" minOccurs=\"0\" maxOccurs=\"0\"/>\r\n        	</sequence>\r\n     			<attribute name=\"TYPE\" default=\"intl postal parcel work\">\r\n   					<simpleType>\r\n   						<list>\r\n   							<simpleType>\r\n       						<restriction base=\"string\">\r\n         						<enumeration value=\"dom\"/>\r\n         						<enumeration value=\"intl\"/>\r\n         						<enumeration value=\"postal\"/>\r\n         						<enumeration value=\"parcel\"/>\r\n         						<enumeration value=\"home\"/>\r\n         						<enumeration value=\"work\"/>\r\n          					<enumeration value=\"pref\"/>\r\n      						</restriction>\r\n     						</simpleType>\r\n    					</list>\r\n   					</simpleType>\r\n     			</attribute>\r\n     			<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n     		</restriction>\r\n    	</complexContent>\r\n   	</complexType>\r\n	</element>\r\n\r\n	<element name=\"TZ\">\r\n		<complexType>\r\n    	<simpleContent>\r\n     		<extension base=\"string\">\r\n      		<attribute name=\"TYPE\">\r\n    				<simpleType>\r\n    					<list>\r\n    						<simpleType>\r\n        					<restriction base=\"string\">\r\n          					<enumeration value=\"text\"/>\r\n       						</restriction>\r\n      					</simpleType>\r\n     					</list>\r\n    				</simpleType>\r\n      		</attribute>\r\n      		<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n     		</extension>\r\n    	</simpleContent>\r\n   	</complexType>\r\n	</element>\r\n\r\n	<element name=\"UID\">\r\n		<complexType>\r\n    	<simpleContent>\r\n     		<extension base=\"string\">\r\n      		<attribute name=\"TYPE\" type=\"string\"/>\r\n      		<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n     		</extension>\r\n    	</simpleContent>\r\n   	</complexType>\r\n	</element>\r\n\r\n	<element name=\"PHOTO\" type=\"vCard:binaryElement\"/>\r\n\r\n	<element name=\"LOGO\" type=\"vCard:binaryElement\"/>\r\n\r\n	<element name=\"SOUND\" type=\"vCard:binaryElement\"/>\r\n\r\n	<element name=\"KEY\" type=\"vCard:binaryElement\"/>\r\n\r\n	<element name=\"AGENT\">\r\n		<complexType>\r\n			<sequence>\r\n				<any namespace=\"##targetNamespace\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			</sequence>\r\n			<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n		</complexType>\r\n	</element>\r\n\r\n	<element name=\"GROUP\">\r\n		<complexType>\r\n			<sequence>\r\n				<any namespace=\"##targetNamespace\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\r\n			</sequence>\r\n			<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n		</complexType>\r\n	</element>\r\n\r\n	<element name=\"URL\">\r\n		<complexType>\r\n			<attributeGroup ref=\"xlink:simpleLink\"/>\r\n		</complexType>\r\n	</element>\r\n</sequence>\r\n			<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n			<attribute ref=\"xml:base\" use=\"optional\"/>\r\n		</complexType>\r\n	</element>\r\n\r\n	<complexType name=\"simpleElement\">\r\n    <simpleContent>\r\n      <extension base=\"string\">\r\n        <attribute ref=\"xml:lang\" use=\"optional\"/>\r\n      </extension>\r\n    </simpleContent>\r\n  </complexType>\r\n\r\n	<complexType name=\"binaryElement\">\r\n  	<simpleContent>\r\n   		<extension base=\"base64Binary\">\r\n    		<attribute name=\"ENCODING\" default=\"b\">\r\n  				<simpleType>\r\n  					<list>\r\n  						<simpleType>\r\n      					<restriction base=\"string\">\r\n									<enumeration value=\"b\"/>\r\n									<enumeration value=\"\"/>\r\n        				</restriction>\r\n        			</simpleType>\r\n        		</list>\r\n        	</simpleType>\r\n        </attribute>\r\n    		<attribute name=\"TYPE\" type=\"string\"/>\r\n    		<attribute ref=\"xml:lang\" use=\"optional\"/>\r\n    		<attributeGroup ref=\"xlink:simpleLink\"/>\r\n   		</extension>\r\n  	</simpleContent>\r\n 	</complexType>\r\n\r\n\r\n<!-- stuff from xlink.xsd -->\r\n\r\n  <!--  global attributes  --> \r\n  <attribute name=\"href\"  type=\"anyURI\"/>\r\n  <attribute name=\"role\" type=\"string\"/>\r\n  <attribute name=\"arcrole\" type=\"string\"/>\r\n  <attribute name=\"title\" type=\"string\" /> \r\n  <attribute name=\"show\">\r\n    <simpleType>\r\n      <restriction base=\"string\">\r\n	<enumeration value=\"new\" /> \r\n	<enumeration value=\"replace\" /> \r\n	<enumeration value=\"embed\" /> \r\n	<enumeration value=\"other\" /> \r\n	<enumeration value=\"none\" /> \r\n      </restriction>\r\n    </simpleType>\r\n  </attribute>\r\n  <attribute name=\"actuate\">\r\n    <simpleType>\r\n      <restriction base=\"string\">\r\n	<enumeration value=\"onLoad\" /> \r\n	<enumeration value=\"onRequest\" /> \r\n	<enumeration value=\"other\" /> \r\n	<enumeration value=\"none\" /> \r\n      </restriction>\r\n    </simpleType>\r\n  </attribute>\r\n  <attribute name=\"label\" type=\"string\" /> \r\n  <attribute name=\"from\" type=\"string\" /> \r\n  <attribute name=\"to\" type=\"string\" /> \r\n  <attributeGroup name=\"simpleLink\">\r\n    <attribute name=\"type\" type=\"string\" fixed=\"simple\" form=\"qualified\" /> \r\n    <attribute ref=\"xlink:href\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:role\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:arcrole\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:title\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:show\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:actuate\" use=\"optional\" /> \r\n  </attributeGroup>\r\n  <attributeGroup name=\"extendedLink\">\r\n    <attribute name=\"type\" type=\"string\" fixed=\"extended\" form=\"qualified\" /> \r\n    <attribute ref=\"xlink:role\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:title\" use=\"optional\" /> \r\n  </attributeGroup>\r\n  <attributeGroup name=\"locatorLink\">\r\n    <attribute name=\"type\" type=\"string\" fixed=\"locator\" form=\"qualified\" /> \r\n    <attribute ref=\"xlink:href\" use=\"required\" /> \r\n    <attribute ref=\"xlink:role\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:title\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:label\" use=\"optional\" /> \r\n  </attributeGroup>\r\n  <attributeGroup name=\"arcLink\">\r\n    <attribute name=\"type\" type=\"string\" fixed=\"arc\" form=\"qualified\" /> \r\n    <attribute ref=\"xlink:arcrole\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:title\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:show\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:actuate\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:from\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:to\" use=\"optional\" /> \r\n  </attributeGroup>\r\n  <attributeGroup name=\"resourceLink\">\r\n    <attribute name=\"type\" type=\"string\" fixed=\"resource\" form=\"qualified\" /> \r\n    <attribute ref=\"xlink:role\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:title\" use=\"optional\" /> \r\n    <attribute ref=\"xlink:label\" use=\"optional\" /> \r\n  </attributeGroup>\r\n  <attributeGroup name=\"titleLink\">\r\n    <attribute name=\"type\" type=\"string\" fixed=\"title\" form=\"qualified\" /> \r\n  </attributeGroup>\r\n  <attributeGroup name=\"emptyLink\">\r\n    <attribute name=\"type\" type=\"string\" fixed=\"none\" form=\"qualified\" /> \r\n  </attributeGroup>\r\n\r\n\r\n<!-- xml.xsd -->\r\n\r\n  <attribute name=\"lang\" type=\"language\">\r\n  <annotation>\r\n   <documentation>In due course, we should install the relevant ISO 2- and 3-letter\r\n         codes as the enumerated possible values . . .</documentation>\r\n  </annotation>\r\n </attribute>\r\n\r\n <attribute name=\"space\" default=\"preserve\">\r\n  <simpleType>\r\n   <restriction base=\"NCName\">\r\n    <enumeration value=\"default\"/>\r\n    <enumeration value=\"preserve\"/>\r\n   </restriction>\r\n  </simpleType>\r\n </attribute>\r\n\r\n <attribute name=\"base\" type=\"anyURI\">\r\n  <annotation>\r\n   <documentation>See http://www.w3.org/TR/xmlbase/ for\r\n                     information about this attribute.</documentation>\r\n  </annotation>\r\n </attribute>\r\n\r\n <attributeGroup name=\"specialAttrs\">\r\n  <attribute ref=\"xml:base\"/>\r\n  <attribute ref=\"xml:lang\"/>\r\n  <attribute ref=\"xml:space\"/>\r\n </attributeGroup>\r\n\r\n\r\n\r\n\r\n</schema>\r\n','VCARD','v',''),(50,'geospatialMD','1.0','<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<xsd:schema xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\" elementFormDefault=\"qualified\" attributeFormDefault=\"unqualified\" version=\"0.6.50\">\r\n	<xsd:annotation>\r\n		<xsd:documentation>\r\n		**********************************************************************  Overview  **************************************************************\r\n				This is an ADN item-level CATEGORY schema.\r\n				Tags defined: geospatialCoverages\r\n		</xsd:documentation>\r\n	</xsd:annotation>\r\n	<xsd:annotation>\r\n		<xsd:documentation>*** LICENSE INFORMATION *****\r\n  		Copyright 2002, 2003 DLESE Program Center\r\n		University Corporation for Atmospheric Research (UCAR)\r\n		P.O. Box 3000, Boulder, CO 80307, Uni